import React from "react";

export default function Channel({ name, message_count }) {
    console.log(message_count);
    return(
        <div className="channel">
            <div className="channel-icon">X</div>
            <div className="channel-name">{name}</div>
            <div className="message-count">{message_count}</div>
        </div>
    )
}
